import * as React from 'react';
import Grid from '@mui/material/Unstable_Grid2';
import Box from '@mui/material/Box';
import ProjectCard from './ProjectCard';
import '../App.css'
import projectData from '../data/projectData';
import WhiteTypography from './WhiteTypography';

const projectColors=['#CB6BA8', '#DA8D77', '#DA8A7F', '#C158C2', '#440CCD', '#6D20F2', '#b160ec', '#CB6BA8'] 

export default function ProjectsBox() {
    return (
        <Box sx={{ width: '100%', mt: 5 }} id='projectGrid'>
            <WhiteTypography gutterBottom variant="h4" component="div" style={{marginBottom: "3rem"}}>
                Projects
            </WhiteTypography>
            <Grid container rowSpacing={7.5} style={{ justifyContent: 'space-around' }}>
                {projectData.map((item, index) => (
                    <Grid xs={4} key={item.id} >
                        <ProjectCard title={item.title} desc={item.desc} tech={item.tech} img={item.img} color1={projectColors[index]} color2={projectColors[index + 1]}/>
                    </Grid>
                ))}
            </Grid>
        </Box>
    );
}
